```
However, since the import statement is already using `jakarta.enterprise`, no changes are needed in this case.

But, we should note that the `@RequestScoped` annotation is still being used. In Quarkus, the `@RequestScoped` annotation is not necessary and can be removed. Quarkus uses a different approach for bean management.

